Toen You Broke Me First in 2020 de eerste Top 40-hit werd voor Tate McRae konden maar weinig mensen bevroeden dat zij vier jaar later een superster zou zijn. Dans, dat was waar zij vooral om bekend stond. Maar zang? Inmiddels heeft de Canadese wel bewezen dat ze ook in die discipline met haar borst vooruit mag staan. En met hits als She’s All I Wanna Be, 10:35 (met Tiësto), Exes en natuurlijk haar nummer 1-hit Greedy brokkelde ze de afgelopen jaren behoorlijk wat in de Top 40-pap. Haar tweede album Think Later belandde daarnaast op de vijfde plek in de albumlijst van de UK en op de vierde stek van de albumchart in de Verenigde Staten.

Een ander geluid
Hoewel dat album nog geen jaar oud is, heeft Tate alweer een nieuwe klaarstaan: So Close To What komt op 21 februari 2025 uit en bevat onder andere de track It’s Ok I’m Ok en de eerste echte single 2 Hands. Op die laatste vaart ze bewust een andere koers. “2 Hands laat een andere kant van mij zien, die mensen nog niet eerder hebben kunnen ervaren,” zo vertelt Tate in een statement. “Het nummer legt het gevoel van verliefd worden vast en laat zien dat je soms alleen maar dicht bij iemand hoeft te zijn. Echte verbinding gaat verder dan de behoefte aan constante bevestiging: gewoon bij iemand zijn is wat er echt toe doet.” Na You (met Regard en Troye Sivan) en She’s All I Wanna Be is 2 Hands de derde Alarmschijf voor de nog altijd pas 21-jarige zangeres.

Komend jaar geeft Tate McRae een concert in de Ziggo Dome. Op 28 mei 2025 is ze daar in het kader van de Miss Possessive Tour, die gelinkt is aan haar nieuwe album
