Geschreven door leadzangeres Chrissie Hynde en geproduceerd door Chris Thomas, werd het uitgebracht op 18 november 1983 als de tweede single van hun derde studioalbum, Learning to Crawl (1984). 

Het was het populairst in het Verenigd Koninkrijk, waar het in december 1983 piekte op nummer 15 in de UK Singles Chart. 
In de VS werd het uitgebracht als de B-kant van zowel de 7-inch single als de 12-inch single remix van de hit "Middle of the Road" van de band.

Het wordt beschouwd als een kerstlied en is uitgebracht op verschillende kerstcompilatiealbums.

De Britse rockband Coldplay bracht een pianocover van het nummer uit als liefdadigheidssingle. De digitale download van het nummer was beschikbaar voor £ 1,50 tussen 16 december 2003 en 1 januari 2004, waarbij alle royalty''s werden gedoneerd aan Stop Handgun Violence en Future Forests. ', '[Verse 1]
