Zo maakte ze ook haar opwachting op de Grammy’s afgelopen nacht, waar ze tijdens een van de reclameblokken op tv ook een nieuwe single presenteerde van Mayhem, haar eerste album sinds Chromatica uit 2020 . Dat ze met die plaat terug richting haar dancepoproots van de nillies wil, horen we merkbaar op “Abracadabra”. Stevige synths rollen al vanaf de eerste seconde over de toonbank en met haar uitpakkende stem is haar magische formule snel geïdentificeerd. De elektronische invloeden spatten eraf, een licht duister randje is aanwezig en een housepianoriedeltje speelt op de achtergrond. Zoals haar naam het betaamt, klinkt het refrein wat absurd, maar dat kan het nostalgische gevoel niet temperen. Het klinkt nagenoeg zoals Lady Gaga in haar prime en daar zijn we blij om, het enige gevaar dat om de hoek lonkt bij Mayhem is dat het niet kan tippen aan de vroegere hits en daardoor een willen-maar-niet-meer-kunnen-verhaal wordt. Aan Gaga om het tegendeel te bewijzen!', '[Intro]
