Met “Atlas” lost Pommelien zo dus nog eens een nieuw streepje muziek, en daarin ruilt ze de poppunk eventjes in voor iets dat nog het dichtst aanleunt bij gemoedelijke folkpop. Muzikaal leunt haar nieuwste creatie namelijk vooral op een relatief uptempo klinkende akoestische gitaar, terwijl Thijs’ stem geldt als tweede steunpilaar. Tekstueel blinkt de zangeres uit in de strofes, net doordat ze daarin qua diepgang nog net dat tikkeltje diepgaander is beginnen schrijven. Het refrein ligt daarentegen, en weinig verrassend, erg makkelijk in het gehoor, waardoor het volgende hitje in de rij stilaan geboren lijkt. Met “Atlas” toont Pommelien Thijs voor alle duidelijkheid – en misschien wel het belangrijkst – een andere en nieuwe kant van haar kunnen; eentje die aantoont dat ze ook zonder alle bombast of makkelijke popakkoorden kan overtuigen. Ondanks dat het op vlak van thematiek richting een gebroken hart hint, en er dus ook een vleugje melancholie in het geheel genesteld zit, voelt de single tegelijkertijd ook vrij licht aan. En zo grijpt Pommelien dus weer haar kans om de criticasters de mond te snoeren.', '[Verse 1]
